INSERT INTO `myaac_faq` VALUES (1,'Send a parcel to a player?','How do i send a parcel to a player from a city?\r\n\r\n<br>It\'s simple.\r\nwith the lebel inside the parcel, open it and write the name of the player who will send and in the line below the name of the city, without special characters.',0,0),(2,'How do I climb with the rope?','<br>The rope climbing system this version is preserved.\r\n<br>To go up, there must be no players, monsters and items stacked on top of the place the rope is supposed to use, except liquids.',1,0),(3,'How to use runes on players?','<br>This version the battle system is preserved, to attack or heal other players requires experience with the mouse.\r\n<br>With the rune in the backpack, right click on the rune and move the mouse to the player\'s feet and press the left mouse button. <br>Battle is just for attacking runes on monsters.',2,0),(4,'How do I learn spells?','<br>To learn spells, you must have money and a magic level above 0.<br>\r\nMust look for Npcs according to their vocation.',3,0),(5,'How do I pay house rent?','You must keep an amount of money above the rent in the depository of the city to which the house is attached. when you run out of money in the deposit you will be notified by letter for 7 days before the rent is due.',4,0),(6,'Do raids have specific times?','No, Raids are random. any time there can be an attack, so also unannounced raids.',5,0);
/*!40000 ALTER TABLE `myaac_faq` ENABLE KEYS */;
UNLOCK TABLES;

