INSERT INTO `myaac_news` VALUES (1,'End beta!','<p>The beta version is over, the opening will be after the timer closes, and it will open automatically on a Saturday at 19:00h. Brasilia time.</p>',2,1689169250,1,2,2,1696060311,'0','','images/news/announcement.jpg',0),(2,'Welcome Tibians','<p style=\"text-align: center;\"><em><strong>Welcome to TibiaCore 7.4</strong></em></p>\r\n<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/L3Nlvzz.png\" alt=\"\" width=\"513\" height=\"385\" /></p>\r\n<p style=\"text-align: center;\">Dear player.&nbsp;We are pleased to announce that our server will definitely be open as we prepare for the grand opening.&nbsp;Soon, you will have the opportunity to embark on an incredible journey filled with nostalgia and excitement.</p>\r\n<p style=\"text-align: center;\">At TibiaCore, we are committed to maintaining the original essence of the game, without any weapons or other customized items except items usable for donors. We understand the importance of preserving the authenticity and nostalgia that gamers cherish.</p>\r\n<p style=\"text-align: center;\">Get ready to join us on this incredible adventure! Stay tuned for the official opening announcement and be one of the first to experience the excitement of TibiaCore.</p>\r\n<p style=\"text-align: center;\">Get ready for an unforgettable journey full of excitement, camaraderie and epic battles. We can\'t wait to welcome you to our server!</p>\r\n<p style=\"text-align: center;\">Enjoy the game!</p>',1,1689657960,5,2,2,1696230646,'1','','images/news/announcement.jpg',0),(3,'serverinfo','<p>Server information has been updated!</p>',2,1689880437,4,0,0,0,'0','','',0),(4,'p.a','<p>On opening day, premium account will be added as soon as it opens!</p>',2,1689899587,5,0,2,1696060319,'0','','images/news/announcement.jpg',0),(5,'shop page','<p>Improved and updated shop page.</p>',2,1696649180,2,2,0,0,'0','','',0),(6,'House Auction!','<p style=\"text-align: left;\"><em><strong>Dear Players&nbsp;</strong></em><em>House Auctions have been implemented. Now, everyone can place bids.</em><br /><br /><em>The bids will be valid if:</em><br /><em>1. You have money in the depot of the city where the house is being auctioned.</em><br /><em>2. You do not remove your money from the depot or engage in any fraudulent activities.<br /><br /></em><em>Those who wish to place bids must have enough money to cover the bid amount and the house rent. <br />If you do not have sufficient funds, please ensure you deposit the bid amount and rent in advance. Failure to do so will result in a 7-day your account suspension from the house auction system.<br /><br />Remember, it\'s money in the deposit of the city where the house is. and in the bid+rent value, the rent is postponed for 30 days.<br /></em></p>\r\n<p><em>It is now no longer possible to buy a house using the !buyhouse command.<br /></em><em>But you can sell with trade by doing !sellhouse (player name)</em></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left;\"><em><strong>Thank you for your attention!</strong></em></p>',1,1697008634,4,2,2,1697174307,'2','','images/news/announcement.jpg',0),(7,'pages','<p>We have corrected some pages and they are now available.</p>',2,1697257165,2,2,0,0,'0','','',0),(8,'Hunt or mysteries?','<p style=\"text-align: center;\"><iframe src=\"//www.youtube.com/embed/pKSkLRAGqS4\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>',1,1697352383,5,2,2,1697491205,'3','','images/news/announcement.jpg',0),(9,'otservlist','<p>We fixed the server going offline error on otservlist.org</p>',2,1697594095,2,2,0,0,'0','','',0),(10,'Live System.','<pre style=\"text-align: center;\"><em><strong>Now we have live system!<br /></strong></em>To enter, just press enter without entering your account number and password<br /><br /></pre>\r\n<pre style=\"text-align: center;\"><strong>!cast</strong>. start the live without a password.<br /><br /><strong>!cast</strong> <strong>123</strong>. start live with password.<br /><br /><strong>/name nick</strong>. changes the spectator\'s name.<br /><br /><strong>/spectators</strong>. show the number of spectators in the live.<br /><br /><br />In addition, premium accounts gain 5% more exp with open live, this does not apply to party!</pre>',1,1697731688,4,2,2,1697814267,'5','','images/news/announcement.jpg',0);
/*!40000 ALTER TABLE `myaac_news` ENABLE KEYS */;
UNLOCK TABLES;

