xt-align: center;\">shovel, rope any health</p>\r\n<h4 style=\"text-align: center;\">Monsters to Face:</h4>\r\n<p style=\"text-align: center;\">minotaurs, archers and guards.</p>\r\n<h4 style=\"text-align: center;\">Reward:</h4>\r\n<p style=\"text-align: center;\">mining helmet andpossibility to buy pickaxes and upgrade, make weapons and armor.</p>\r\n<hr />\r\n<p style=\"text-align: center;\"><strong>First visite Npc west from depot kazordoon, t</strong><strong>alk about a mission.</strong></p>\r\n<p style=\"text-align: center;\"><strong>He asks you to speak with Budrik, located in a mine to the west.</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/WkVM3h8.png\" alt=\"\" width=\"514\" height=\"302\" /></p>\r\n<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\"><strong>Budrik asks for your help, and you\'ll have to face some minotaurs to the south west of the region.</strong></p>\r\n<p style=\"text-align: center;\"><img src=\"https://i.imgur.com/RVR9Acm.png\" alt=\"\" width=\"515\" height=\"303\" /></p>\r\n<p style=\"text-align: center;\"></p>\r\n<p style=\"text-align: center;\"><strong>Get the helmet behind the door and go back to Budrik.</strong></p>\r\n<p style=\"text-align: center;\"><strong>After that go back to dwarf blacksmith.</strong></p>\r\n<p style=\"text-align: center;\"><strong><img src=\"https://i.imgur.com/o2TJLzs.png\" alt=\"\" width=\"559\" height=\"426\" /></strong></p>\r\n<p style=\"text-align: center;\"><strong>C</strong><strong>omplete the mission. then ask for a pickaxe.</strong></p>',0,1,0,1,1,0),(5,'quest','Quests','<h3 style=\"text-align: center;\"><strong><a href=\"http://tibiacore.online/?kazordoon_miner\">Kazordoon Miner</a></strong></h3>',0,1,0,1,1,0),(6,'mining','Mining','<p style=\"text-align: center;\"><strong><img src=\"https://tibiacore.online/images/items/4484.gif\" alt=\"\" width=\"32\" height=\"32\" /></strong><strong>Steel Pickaxe</strong></p>\r\n<table style=\"border-collaps